[{"location":"api/#API","page":"API","title":"API","text":"","category":"section"},{"location":"api/#NLPModels-API","page":"API","title":"NLPModels API","text":"","category":"section"},{"location":"api/","page":"API","title":"API","text":"AmplNLReader implements the NLPModels API.","category":"page"},{"location":"api/#Internal","page":"API","title":"Internal","text":"","category":"section"},{"location":"api/","page":"API","title":"API","text":"Modules = [AmplNLReader]\nPages   = [\"AmplNLReader.jl\"]\nOrder   = [:function]","category":"page"},{"location":"reference/#Reference","page":"Reference","title":"Reference","text":"","category":"section"},{"location":"reference/","page":"Reference","title":"Reference","text":"","category":"page"},{"location":"#AmplNLReader.jl-documentation","page":"Home","title":"AmplNLReader.jl documentation","text":"","category":"section"},{"location":"","page":"Home","title":"Home","text":"This package provides an interface to optimization problems modeled in the AMPL modeling language.","category":"page"},{"location":"","page":"Home","title":"Home","text":"Currently, only smooth problems are supported.","category":"page"},{"location":"","page":"Home","title":"Home","text":"This package implements the NLPModels.jl API.","category":"page"},{"location":"","page":"Home","title":"Home","text":"Interaction with AMPL models is realized by way of the AMPL Solver Library (ASL) as implemented by David Gay.","category":"page"},{"location":"","page":"Home","title":"Home","text":"Most, but not all, AMPL models come in the form of a model file (problem.mod) and a data file (problem.dat). For this reason, AmplNLReader assumes that an nl file is available. An nl file is the result of decoding a model and, possibly, a data file to instantiate a concrete problem. One can be generated from the command line using","category":"page"},{"location":"","page":"Home","title":"Home","text":"ampl -ogproblem problem.mod problem.dat","category":"page"},{"location":"","page":"Home","title":"Home","text":"where problem should be replaced with your problem's name.","category":"page"},{"location":"","page":"Home","title":"Home","text":"For an introduction to the AMPL modeling language and background on the ASL, see","category":"page"},{"location":"","page":"Home","title":"Home","text":"R. Fourer, D. M. Gay, and B. W. Kernighan, AMPL: A Mathematical Programming Language, Management Science 36, pp. 519-554, 1990.\nR. Fourer, D. M. Gay, and B. W. Kernighan, AMPL: A Modeling Language for Mathematical Programming, Duxbury Press / Brooks/Cole Publishing Company, 2003\nD. M. Gay, Hooking your Solver to AMPL, Technical Report 97-4-06, Computing Sciences Research Center, Bell Laboratories, Murray Hill, NJ, 1997.\nD. Orban, The Lightning AMPL Tutorial. A Guide for Nonlinear Optimization Users, GERAD Technical Report G-2009-66, 2009.","category":"page"},{"location":"#Installing","page":"Home","title":"Installing","text":"","category":"section"},{"location":"","page":"Home","title":"Home","text":"The following command should automatically download and install AmplNLReader.jl and its dependencies (Use ] to enter pkg> mode):","category":"page"},{"location":"","page":"Home","title":"Home","text":"pkg> add AmplNLReader\npkg> build AmplNLReader\npkg> test AmplNLReader","category":"page"},{"location":"#Usage","page":"Home","title":"Usage","text":"","category":"section"},{"location":"","page":"Home","title":"Home","text":"julia> using AmplNLReader\n\njulia> hs33 = AmplModel(\"hs033.nl\")\nMinimization problem hs033.nl\nnvar = 3, ncon = 2 (0 linear)\n\njulia> print(hs33)\nMinimization problem hs033.nl\nnvar = 3, ncon = 2 (0 linear)\nlvar = 1x3 Array{Float64,2}:\n 0.0  0.0  0.0\nuvar = 1x3 Array{Float64,2}:\n Inf  Inf  5.0\nlcon = 1x2 Array{Float64,2}:\n -Inf  4.0\nucon = 1x2 Array{Float64,2}:\n 0.0  Inf\nx0 = 1x3 Array{Float64,2}:\n 0.0  0.0  3.0\ny0 = 1x2 Array{Float64,2}:\n -0.0  -0.0","category":"page"},{"location":"","page":"Home","title":"Home","text":"There is support for holding multiple models in memory simultaneously. This should be transparent to the user.","category":"page"},{"location":"","page":"Home","title":"Home","text":"Check the NLPModels API for details on the complete API.","category":"page"},{"location":"#Contents","page":"Home","title":"Contents","text":"","category":"section"},{"location":"","page":"Home","title":"Home","text":"","category":"page"}]
